    number: '6'
    value: 'In response to a letter dated December 7, 2010 from Mr. Bradley Matheson,
      Campaign Finance Analyst, concerning disclosure of identification of individuals
      who contribute in excess of $200 in an election cycle, the committee has demonstrated
      a best effort attempt to obtain employer and occupation information from all
      contributors making contribution in excess of $200. The steps that this committee
      has taken are as follows:  First, at the time of the original solicitation a
      request card is enclosed asking each contributor for the needed information.  This
      card states the reason for the information citing the federal statue.  If the
      needed information is not received then a series of telephone calls are made
      to the contributors as a stand alone effort.  These calls are made within 15
      days of the contribution.  Finally, if the series of telephone calls are not
      successful, then a letter is sent to the individual.  This letter clearly asks
      for the missing information without soliciting an additional contribution.'
